import React from 'react' 
import { useHistory } from "react-router-dom";
import sd from "../assets/img/ZooLogos/SanDiego.png";
import bronx from "../assets/img/ZooLogos/bronx.png";
import oak from "../assets/img/ZooLogos/Oakland.png";
import elm from "../assets/img/ZooLogos/Elmswood.png";

function AcctNavigation() {
    let history = useHistory();

    // When logo gets clicked, push AcctPage with tag for Account/Logo being used
    function handleClick(sourceTag, address) {
        history.push("/ZooPage", {imgSrc: sourceTag, account: address})
        //console.log(sourceTag)
    }

    return (
     <div>
        <button onClick={() => handleClick("sd", "0x117dfbf6be9cac04")} type="button">
            <img 
                src={sd} 
                id="icon"
                alt="SDZooLogo" 
                title="SDZoo"> 
            </img>
        </button>
        <button onClick={() => handleClick("bronx", "0x045a1763c93006ca")} type="button">
            <img 
                src={bronx} 
                id="icon"
                alt="BronxZooLogo" 
                title="BronxZoo"> 
            </img>
        </button>
        <button onClick={() => handleClick("oak", "0x7e4d8e1b1f546ba9")} type="button">
            <img 
                src={oak} 
                id="icon"
                alt="OakZooLogo" 
                title="OakZoo"> 
            </img>
        </button>
        <button onClick={() => handleClick("elm", "0x7e4d8e1b1f546ba9")} type="button">
            <img 
                src={elm} 
                id="icon"
                alt="ElmZooLogo" 
                title="ElmZoo"> 
            </img>
        </button>
     </div>
    );
  }
  export default AcctNavigation;
